### Problem03

Look at the following code in java:

```java
int n = 20;
int count = 0;
    for (int i = 0; i < n; i++)
        for (int j = i + 1; j < n; j++)
            for (int k = j + 1; k < n; k++)
                count++;
```

After executing this code, the value of 'count' will be  _____(0)\___ (in exact number).

